import bz2, base64
d=""
d+='='*(-len(d)%4)
d=bz2.decompress(base64.b64decode(d))

n, q = map(int, input().split())
b = 0
for i in range(2, n):
	b += 3 ** i
for i in range(q):
	s = input()
	x = 0
	for c in s:
		x = x * 3 + ord(c) - ord('A')
	j = b + x
	print(int.from_bytes(d[j*4:j*4+4],byteorder='little'))
